import axios from "axios";

const API_URL = "http://localhost:5000/api/maharajs";

export const getMaharajs = async () => {
  const response = await axios.get(API_URL);
  return response.data;
};

export const addMaharaj = async (maharaj) => {
  await axios.post(API_URL, maharaj);
};

export const updateMaharaj = async (id, maharaj) => {
  await axios.put(`${API_URL}/${id}`, maharaj);
};

export const deleteMaharaj = async (id) => {
  await axios.delete(`${API_URL}/${id}`);
};

export default { getMaharajs, addMaharaj, updateMaharaj, deleteMaharaj };
